// src/data/blog/potato-problem.js
const post = {
    id: "potato-problem",
    title: "The Potato Problem",
    publication: "Personal Blog, 2025",
    date: "2025-05-07",
    summary: "The optimal amount of cuts to objects such that they're relatively similar weights.",
    content: `
#

I was recently cooking dinner for me and my girlfriend. Upon opening a pack of New Potatoes, ready with boiling water, I saw that many of the potatoes were small and many were large.


    `
  };

  export default post;
